import React, { useState } from 'react';
import './UploadPage.css'; // Import the CSS for styling
import Navbar from './Navbar';

const UploadPage = () => {
  const [formData, setFormData] = useState({
    accountNumber: '',
    userName: '',
    email: '',
    image: null,
  });

  const [error, setError] = useState('');
  const [message, setMessage] = useState(''); // For success or error messages

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name === 'accountNumber') {
      // Validate account number length
      if (value.length > 10) {
        setError('Account number must be exactly 10 digits');
        return;
      } else if (!/^\d*$/.test(value)) {
        setError('Account number must contain only digits');
        return;
      } else {
        setError('');
      }
    }

    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleImageChange = (e) => {
    setFormData({
      ...formData,
      image: e.target.files[0], // Store the actual file
    });
  };

  const convertToBase64 = (file) => {
    return new Promise((resolve, reject) => {
      const reader = new FileReader();
      reader.readAsDataURL(file);
      reader.onload = () => resolve(reader.result);
      reader.onerror = (error) => reject(error);
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage(''); // Clear previous messages
    setError(''); // Clear previous errors

    const { accountNumber, userName, email, image } = formData;

    // Ensure the account number is valid before submitting
    if (accountNumber.length !== 10) {
      setError('Account number must be exactly 10 digits');
      return;
    }

    if (!image) {
      setError('Please upload an image');
      return;
    }

    try {
      const base64Image = await convertToBase64(image); // Convert image to Base64 string

      const response = await fetch('http://localhost:5000/api/account/add-account', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          accountNumber,
          userName,
          email,
          image: base64Image, // Send Base64 string
        }),
      });

      const result = await response.json();

      if (response.ok) {
        setMessage('Account added successfully!');
      } else {
        setError('Failed to add account: ' + result.message);
      }
    } catch (error) {
      console.error('Error uploading data:', error);
      setError('Error uploading data: ' + error.message);
    }
  };

  return (
    <div>
      <Navbar /> {/* Include the Navbar */}
      <div className="upload-page">
        <div className="form-container">
          <h2>Upload Image and Details</h2>
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="accountNumber">Account Number:</label>
              <input
                type="text"
                id="accountNumber"
                name="accountNumber"
                value={formData.accountNumber}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="userName">User Name:</label>
              <input
                type="text"
                id="userName"
                name="userName"
                value={formData.userName}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="email">Email:</label>
              <input
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="image">Upload Image:</label>
              <input
                type="file"
                id="image"
                name="image"
                onChange={handleImageChange}
                accept="image/*"
                required
              />
            </div>

            {formData.image && (
              <div className="image-preview">
                <img src={URL.createObjectURL(formData.image)} alt="Preview" />
              </div>
            )}

            <button type="submit" className="submit-btn">
              Submit
            </button>
          </form>

          {/* Display error or success messages */}
          {error && <div className="error-message">{error}</div>}
          {message && <div className="success-message"  style>{message}</div>}
        </div>
      </div>
    </div>
  );
};

export default UploadPage;
